sys_variable_value.value:
(function execute(inputs, outputs) {

  const TABLE = "x_g_dis_atat_disa_organization";
  let numAdded = 0;
  let numDuplicates = 0;
  let numErrors = 0;

  const disaOrgs = JSON.parse(inputs.formatted_disa_orgs).forEach(function(org) {
    const query = new global.GlideQuery(TABLE);
    gs.info("handling " + org.orgId);
    const foundRecords = query 
    .where("css_id", org.orgId)
    .count();

    if (foundRecords > 0) {
      numDuplicates++;
    }
    else {
      try {
        query.insert({
          full_name: org.title,
          abbreviation: org.orgSynonym,
          css_id: org.orgId,
        });     

        numAdded++        
      } catch (error) {
        gs.error("Error adding DISA Organization '" + org.title + "': " + error);
        numErrors++;
      }

    }
  })

  outputs.num_added = numAdded;
  outputs.num_duplicates = numDuplicates; 
  outputs.num_errors = numErrors; 

})(inputs, outputs);

